import Topbar from "./topbar";
import LogoIcon from "../../icons/logo";
import HeartIcon from "../../icons/heart";
import CartIcon from "../../icons/cart";

function Header() {
  const design = {
    container: "border",
  };
  const position = {
    container: "flex justify-between px-5 py-2 items-center",
    wrapper: "flex gap-4",
  };

  return (
    <>
      <Topbar />
      <div className={`${design.container} ${position.container}`}>
        <LogoIcon />
        <div className={position.wrapper}>
          <p>Men</p>
          <p>Women</p>
          <HeartIcon />
          <CartIcon />
        </div>
      </div>
    </>
  );
}

export default Header;
